ISLAMABAD, Apr 01 (APP): Ten more members of the National Assembly on Monday took the oath of the member of the National Assembly. Speaker of the National Assembly, Sardar Ayaz Sadiq has administered the oath from the newly elected members.
Among those who took the oath were Abdul Rehman Khan Kanju, Saira Afzal Tarar, Saima Zahid, Kanwal Nauman, Bushra Anjam Butt, Huma Akhtar Chughtai, Mahjabeen Abbasi, Gulnaz Shahzadi, Shumaila Rana, Shazia Fareed, and Syeda Amna Batool.
